import { ButtonGroup, FormGroup,Navbar, NavItem } from "react-bootstrap";
import classes from "./NavigBar.module.css";
function NavigBar() {
  return (
    <div>
      <div className={classes.container}>
        <Navbar>
          <Navbar.Header>
            <Navbar.Brand>
              <a href="#home">Brand</a>
            </Navbar.Brand>
            <Navbar.Toggle />
          </Navbar.Header>
          <Navbar.Collapse>
            <Navbar.Form pullLeft>
              <FormGroup>
                <FormControl type="text" placeholder="Search" />
              </FormGroup>{" "}
              <Button type="submit">Submit</Button>
            </Navbar.Form>
          </Navbar.Collapse>
        </Navbar>
      </div>
    </div>
  );
}
export default NavigBar;
